import React from 'react';

const RegForm = ()=>{

    const changeEvent =(event)=>{
        console.log()
    }
    const submitForm = ()=>{
        console.log("Submit Form")
    }
    return (
        <>
            <h1>Registration Form</h1>
            <form onSubmit={submitForm}>

            <input type='text' name='fname' onChange={changeEvent} />
            <input type='text' name='lname' onChange={changeEvent}/>
            <input type='email' name='email' onChange={changeEvent}/>
            <button type="submit">Submit</button>

            </form>
        </>
    );
}

export default RegForm;
